tables.table_schema:
CREATE TABLE cross_docking (
    dock_id INT PRIMARY KEY,
    dock_location VARCHAR(255),
    dock_capacity INT,
    available_space INT
);

CREATE TABLE shipment_schedule (
    id INT PRIMARY KEY,
    shipment_id INT,
    arrival_date DATE,
    departure_date DATE
);

CREATE TABLE delivery_timelines (
    id INT PRIMARY KEY,
    shipment_id INT,
    delivery_date DATE,
    status VARCHAR(255)
);

CREATE TABLE cross_docking (
    id INT PRIMARY KEY,
    location_id INT,
    arrival_time TIME,
    departure_time TIME
);

CREATE TABLE logistics_providers (
    id INT PRIMARY KEY,
    name VARCHAR(255),
    contact VARCHAR(255),
    country VARCHAR(255)
);

CREATE TABLE shipment_tracking (
    id INT PRIMARY KEY,
    shipment_id INT,
    location_id INT,
    status VARCHAR(255)
);
